import React from "react";
import { Link } from "react-router-dom";
import "../../styles/result.css";
import Charizard from "../../assets/charizard.png";

function ResultPage() {
  var save = JSON.parse(localStorage.getItem("Trade"));
  save.map((index) => {
    if (index !== undefined) {
      console.log(index.quantity);
      console.log(index);
    } else {
      console.log(index.pokemon);
    }
  });

  const calculateBaseExperience = () => {
    var subtract = 0;
    var totalPlayer1=0;
    var totalPlayer2=0;
    save.map((index) => {
        totalPlayer1 = index.quantity * index.pokemon.experience;
        // console.log(totalPlayer1);
        return totalPlayer1;
    });

  };

  return (
    <div className="ResultGlobalContent">
      <div className="ResultTextButton">
        <div className="ResultTextContent">troca boa ein</div>
        <div className="ResultButtonJogar">
          <Link style={{ textDecoration: "none" }} to={{ pathname: "/" }}>
            <button className="ButtonResult">Jogar novamente</button>
          </Link>
        </div>
      </div>
      <div className="ResultImg">
        <img alt="Charizard pokemon" src={Charizard} onClick={calculateBaseExperience}/>
      </div>
    </div>
  );
}

export default ResultPage;
